import BaseRenderer from 'diagram-js/lib/draw/BaseRenderer';
//import 'diagram-js/lib/draw/BaseRenderer';

import {
  assign
} from 'min-dash';
import {
  attr as domAttr
} from 'min-dom';

import {
  isTypedEvent,
  isThrowEvent,
  isCollection,
  getBounds,
  getDi,
  getSemantic,
  getCirclePath,
  getRoundRectPath,
  getDiamondPath,
  getRectPath,
  getFillColor,
  getStrokeColor,
  getLabelColor,
  getHeight,
  getWidth
} from 'bpmn-js/lib/draw/BpmnRenderUtil';

import { is } from 'bpmn-js/lib/util/ModelUtil';
import { isAny } from 'bpmn-js/lib/features/modeling/util/ModelingUtil';

import { append as svgAppend, create as svgCreate, attr as svgAttr, classes as svgClasses } from "tiny-svg";



const HIGH_PRIORITY = 1500,
  TASK_BORDER_RADIUS = 2;

class CustomRenderer extends BaseRenderer {
  constructor(eventBus, bpmnRenderer, textRenderer) {
    super(eventBus, HIGH_PRIORITY);

    this.bpmnRenderer = bpmnRenderer;
    this.textRenderer = textRenderer
  }

  canRender(element) {
    // only render tasks and events (ignore labels)
    return isAny(element, ['vng:zaken']) && !element.labelTarget;
  }

  drawShape(parentNode, element) {

    if (element.type === "vng:zaken") {

      // Main block
      const rect = svgCreate("rect");
      rect.setAttribute("width", element.width);
      rect.setAttribute("height", element.height);
      rect.setAttribute("stroke", "black");
      rect.setAttribute("fill", "white");
      rect.setAttribute("stroke-width", 2);

      svgAppend(parentNode, rect);

      // Render text from name
      renderEmbeddedLabel(parentNode, element, 'center-middle', this.textRenderer);

      //console.log('parent', parentNode);

      // Image in the top corner
      const rect2 = svgCreate("image");
      rect2.setAttribute("width", element.width / 3);
      rect2.setAttribute("height", element.height / 3);
      rect2.setAttribute("x", 0);
      rect2.setAttribute("y", 0);
      //rect2.setAttribute("border", "1px red solid");
      //rect2.setAttribute("z-index", "1000");
	  rect2.setAttribute("href", "data:image/png;base64,	  ");
      //rect2.setAttribute("href", "data:image/png;base64,");

      svgAppend(parentNode, rect2);

      return rect;
    }
  }

  getName(element) {
    return element.name
  }

  getShapePath(shape) {
    const { x, y, width, height } = shape;
    return [
      ["M", x, y],
      ["l", width, 0],
      ["l", 0, height],
      ["l", -width, 0],
      ["z"]
    ];
  }
}

function renderLabel(parentGfx, label, textRenderer, attrs = {}) {
  attrs = assign({
    size: {
      width: 100
    }
  }, attrs);

  var text = textRenderer.createText(label || '', attrs);

  svgClasses(text).add('djs-label');

  svgAppend(parentGfx, text);

  return text;
}

function renderEmbeddedLabel(parentGfx, element, align, textRenderer, attrs = {}) {
  var semantic = getSemantic(element);

  var box = getBounds({
    x: element.x,
    y: element.y,
    width: element.width,
    height: element.height
  }, attrs);

  return renderLabel(parentGfx, semantic.name, textRenderer, {
    align,
    box,
    padding: 7,
    style: {
      fill: "#000"
    }
  });
}

CustomRenderer.$inject = ['eventBus', 'bpmnRenderer', 'textRenderer'];

export default {
  __init__: ['CustomRenderer'],
  CustomRenderer: ['type', CustomRenderer]
};
